import Tables from "_c/tables";
import { getErrorTableData } from "@/api/data";
export default {
  name: "error-list",
  components: {
    Tables
  },
  data() {
    return {
      columns: [
        { title: "ID", key: "ErrorLogId", sortable: true },
        { title: "接口类型", key: "ApiType" },
        { title: "控制器名", key: "ControlerName" },
        { title: "接口消耗时间（毫秒）", key: "RequestTime" },
        { title: "错误信息", key: "ErrorMsg" },
        { title: "错误类型", key: "ErrorType" },
        { title: "Url", key: "Url" },
        { title: "添加时间", key: "AddTime" }
      ],
      tableData: [],
      pageSize: 10,
      pageNum: 1,
      total: 0
    };
  },
  methods: {
    handleDelete(params) {
      console.log(params);
    },
    exportExcel() {
      this.$refs.tables.exportCsv({
        filename: `table-${new Date().valueOf()}.csv`
      });
    },
    PageChange(PageNum) {
      this.pageNum = PageNum;
      this.updataModel();
    },
    HandlePageSize(PageSize) {
      this.pageSize = PageSize;
      this.updataModel();
    }
  },
  mounted() {
    getErrorTableData(this.pageSize, this.pageNum).then(res => {
      this.tableData = res.data.Data.List;
      this.total = res.data.Data.Count;
    });
  }
};
